import React from 'react';
import { Link } from 'react-router-dom';
import './sidebar.css';
import cloud from './cloud.png';
import moon from './moon.png';

const Sidebar = () => {
    return (
        <>
            <div className="sidebar">
                <img style={{ width: '10vw' }} src={cloud} />
                <li>
                    <div className="link-container">
                        <img src={moon} />
                        <Link to="/page1">личный кабинет</Link>
                    </div>
                </li>
                <li>
                    <div className="link-container">
                        <img src={moon} />
                        <Link to="/page2">добавить сон</Link>
                    </div>
                </li>
                <li>
                    <div className="link-container">
                        <img src={moon} />
                        <Link to="/page3">рандомный сон</Link>
                    </div>
                </li>
            </div>
            <li id='exit'>
                <div className="link-container">
                    <img src={moon} />
                    <Link to="/page3">выход</Link>
                </div>
            </li>
        </>
    );
};

export default Sidebar;
